import { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [data, setData] = useState(null);
  useEffect(() => {
      const res = fetch("/api");
      const json = res.json();
      setData(json);

    fetchData(); 
  }, []);


  return (
    <div className="App">
      <header className="App-header">
      {data ? <p>{data.message}</p> : <p>Loading...</p>}
      </header>
    </div>
  );

}

export default App;
